import { Component } from "react";
import {
    Form, Input,
    Button, Checkbox
} from "antd";
import "./index.css";

const FormItem = Form.Item;

export default class Login extends Component {
    onFinish = value => {
        console.log('Success: ', value);
    }

    onFinishFailed = errorInfo => {
        console.log('Failed: ', errorInfo);
    }

    render() {
        const { onFinish, onFinishFailed } = this;

        return (
            <div className="login">
                <div className="content">
                    <Form
                        name="basic"
                        labelCol={{ span: 6 }}
                        wrapperCol={{ span: 17 }}
                        initlalValues={{ remember: true }}
                        onFinish={onFinish}
                        onFinishFailed={onFinishFailed}
                        autoComplete="off"
                    >
                        <FormItem
                            label="Username"
                            name="username"
                            rules={
                                [
                                    {
                                        required: true,
                                        message: 'Please input your username!'
                                    }
                                ]
                            }
                        >
                            <Input />
                        </FormItem>
                        <FormItem
                            label="Password"
                            name="password"
                            rules={
                                [
                                    {
                                        required: true,
                                        message: 'Please input your password!'
                                    }
                                ]
                            }
                        >
                            <Input />
                        </FormItem>
                        <FormItem
                            wrapperCol={{ offset: 8, span: 16 }}
                        >
                            <Button
                                type="primary"
                                htmlType="submit"
                            >
                                Submit
                            </Button>
                        </FormItem>
                    </Form>
                </div>
            </div>
        )
    }
}
